import { AppBar, Toolbar, Typography, styled, InputBase, IconButton, Box, Menu, MenuItem } from '@mui/material'
import ShoppingBagTwoToneIcon from '@mui/icons-material/ShoppingBagTwoTone';
import React, { useState } from 'react'
import Badge from '@mui/material/Badge';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import PersonIcon from '@mui/icons-material/Person';
import FavoriteIcon from '@mui/icons-material/Favorite';

const StyledToolBar = styled(Toolbar)({
    display: "flex",
    justifyContent: "space-between",
    backgroundColor: "orange",
});
const Search = styled("div")(({ theme }) => ({
    backgroundColor: "white",
    padding: "0 10px",
    borderRadius: theme.shape.borderRadius,
    width: "20%"
}));
const Icons = styled("Box")(({ theme }) => ({
    display: "none",
    alignItems: "center",
    gap: "20px",
    color: "white",
    [theme.breakpoints.up("sm")]: {
        display: "flex"
    }
}));
const StyledBadge = styled(Badge)(({ theme }) => ({
    '& .MuiBadge-badge': {
        right: -3,
        top: 13,
        border: `2px solid ${theme.palette.background.paper}`,
        padding: '0 4px',
    },
}));

export const Navbar = () => {
    const [open,setOpen]=useState(false)
    return (
        <AppBar position='sticky'>
            <StyledToolBar>
                <Typography variant='h6' sx={{ display: { sx: "none,", sm: "block" } }}>
                    CATER PİE
                </Typography>
                <ShoppingBagTwoToneIcon sx={{ display: { xs: "block", sm: "none" } }} />
                <Search><InputBase placeholder='search..' /></Search>
                <Icons>
                    <IconButton aria-label="cart">
                        <StyledBadge color="secondary">
                            <FavoriteIcon />
                            <Typography>Favorilerim</Typography>
                        </StyledBadge>
                    </IconButton>
                    <IconButton aria-label="cart">
                        <StyledBadge color="secondary">
                            <ShoppingCartIcon />
                            <Typography>Sepetim</Typography>
                        </StyledBadge>
                    </IconButton>

                    <IconButton aria-label="cart">
                        <StyledBadge color="secondary">
                            <PersonIcon onClick={e=>setOpen(true)}/>
                            <Typography>Hesabım</Typography>
                            

                        </StyledBadge>
                    </IconButton>

                </Icons>


            </StyledToolBar>
            <Menu
                id="demo-positioned-menu"
                aria-labelledby="demo-positioned-button"
                open={true}
                onClose={e=>setOpen(false)}
                anchorOrigin={{
                    vertical: 'top',
                    horizontal: 'right',
                }}
                transformOrigin={{
                    vertical: 'top',
                    horizontal: 'left',
                }}
            >
                <MenuItem >Profile</MenuItem>
                <MenuItem >My account</MenuItem>
                <MenuItem >Logout</MenuItem>
            </Menu>
        </AppBar>
    )
}
